// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./Ownable.sol";


contract VotingSystem is Ownable {
    
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    /// Mappings
    mapping(uint => Candidate) public candidates;
    mapping(address => bool) public hasVoted;

    uint public totalCandidates;

    /// @notice Adds a new candidate (owner only)
    /// @param name The name of the candidate
    function addCandidate(string calldata name) external onlyOwner {
        candidates[totalCandidates] = Candidate({
            id: totalCandidates,
            name: name,
            voteCount: 0
        });

        totalCandidates++;
    }

    /// @notice Vote for a candidate
    /// @param candidateId ID of the candidate to vote for
    function vote(uint candidateId) external {
        require(!hasVoted[msg.sender], "You have already voted");
        require(candidateId < totalCandidates, "Invalid candidate ID");

        hasVoted[msg.sender] = true;
        candidates[candidateId].voteCount++;
    }

    /// @notice Get a candidate's name and vote count
    /// @param candidateId ID of the candidate
    /// @return name The name of the candidate
    /// @return voteCount The vote count of the candidate
    function getCandidate(uint candidateId)
        external
        view
        returns (string memory name, uint voteCount)
    {
        require(candidateId < totalCandidates, "Candidate does not exist");
        Candidate memory candidate = candidates[candidateId];
        return (candidate.name, candidate.voteCount);
    }

    /// @notice Get the total number of candidates
    /// @return The number of candidates
    function getTotalCandidates() external view returns (uint) {
        return totalCandidates;
    }
}

